import React from 'react';
import { Container } from 'react-bootstrap';
import { Route, Switch } from 'react-router-dom';
import ListMovieItems from './components/ListMovieItems';
import MovieItem from './components/MovieItem';
import MovieListTypePage from './components/MovieListTypePage';
import NavigationMenu from './components/NavigationMenu';
import Home from './Home';

function App() {
  return (
    <>
      <NavigationMenu/>
      <Container>
        <Switch>
          <Route path="/movies-in-theaters" component={MovieListTypePage}/>
          <Route path="/movies-coming" component={MovieListTypePage}/>
          <Route path="/top-rated-india" component={MovieListTypePage}/>
          <Route path="/top-rated-movies" component={MovieListTypePage}/>
          <Route path='/' component={Home} />
        </Switch>
      </Container>
    </>
  );
}

export default App;
